    position:relative;
    margin:0 0 60px;
  }
  .teaser-accordions {
    padding-right:35px;
  }
  .teaser-wrap {
    float:right;
  }
  .ihmm-accordion-wrap {
    border-bottom:1px solid #fff;
    padding:20px 0 22px;
    h3 {
      color:#fff;
      font-size:25px;
      font-family:$overlock;
      margin:0;
      position:relative;
      cursor:pointer;
      padding-right:40px;
      &:after {
        content:'';
        display:block;
        width: 0;
        height: 0;
        border-style: solid;
        border-width: 10px 0 10px 18px;
        border-color: transparent transparent transparent #ffffff;
        position:absolute;
        right:5px;
        top:10px;
        transition:all .3s ease;
      }
      &.open {
        &:after {
          transform:rotate(90deg);
        }
      }
    }
    .ihmm-accordion-content {
      height:0;
      overflow:hidden;
      transition:all .3s ease;
      a {
        color:$yellow;
        transition:all .3s ease;
        -webkit-text-fill-color: $yellow; /* Will override color (regardless of order) */
        -webkit-text-stroke-width: 0px;
        -webkit-text-stroke-color: $yellow;
        &:hover {
          -webkit-text-stroke-width: 2px;
        }
      }
      .inner {
        padding:25px;
      }
    }
  }
  .teaser-gallery {
    padding-top:45%;
    position:relative;
    .the-image {
      position:absolute;
      width:55%;
      background-size:cover !important;
      background-position:center !important;
      &.image-1 {
        height:50%;
        top:0;
        left:0;
        border-bottom:5px solid $black;
      }
      &.image-2 {
        height:50%;
        left:0;
        bottom:0;
        border-top:5px solid $black;
      }
      &.image-3 {
        height:100%;
        top:0;
        right:0;
        width:45%;
        background-position:center 70% !important;
        border-left:10px solid $black;
      }
    }
  }
  .cta-wrap {
    text-align:center;
    padding-top:65px;
    a {
      @include btn-default($yellow, $black);
      padding-top:10px;
      padding-bottom:10px;
      font-size:23px;
    }
  }
  @media(max-width:1200px) {
    .ihmm-accordion-wrap {
      padding:13px 0 15px;
      h3 {
        font-size:20px;
        &:after {
          top:5px;
        }
      }
    }
  }
  @media(max-width:992px) {
    .teaser-gallery {
      padding-top:55%;
    }
    .ihmm-accordion-wrap {
      h3 {
        font-size:18px;
        &:after {
          top:3px;
        }
      }
      .ihmm-accordion-content {
        .inner {
          padding:15px 0;
        }
      }
    }
  }
  @media(max-width:768px) {
